import React, { Component, Fragment } from 'react';
import { ToggleItem } from './BodySection.styled.js';

class BodySection extends Component {
  constructor(props){
    super(props);
    this.state={
      currentView: 'snapshot'
    };
  }

  render() {
    return (
      <Fragment>
        <ToggleItem onClick={this.setState({currentView: 'snapshot'})}>SNAP SHOT</ToggleItem>
        <ToggleItem onClick={this.setState({currentView: 'trends'})}>TRENDS</ToggleItem>
        {this.state.currentView === 'trends' ? <div>Sorry Come Back Soon!</div> :
          <div>Nice! You're looking at snapshots.</div>
        }
      </Fragment>
    );
  }
}

export default BodySection;
